from flask import Flask, render_template, session, redirect, url_for, flash, request
import uuid
from models import db, Restaurant, MenuItem, User, Favorite
from config import app, db, login_manager, csrf

# Setup Flask-Login
login_manager.init_app(app)

@login_manager.user_loader
def load_user(user_id):
    return User.query.get(int(user_id))

@app.route('/')
def index():
    if 'user_id' not in session:
        session['user_id'] = uuid.uuid4().hex  # Generate a random UUID
    restaurants = Restaurant.query.all()
    return render_template('index.html', restaurants=restaurants)

@app.route('/favorites')
def favorites():
    user_id = session.get('user_id')
    if not user_id:
        flash("You are not logged in!")
        return redirect(url_for('index'))

    # Assuming you have a relationship set up correctly in your models
    favorites = db.session.query(
        Favorite,
        MenuItem.name,
        MenuItem.image_url
    ).join(MenuItem, Favorite.item_id == MenuItem.id).filter(Favorite.user_id == user_id).all()

    return render_template('favorites.html', favorites=favorites)

@app.route('/menu/<int:restaurant_id>')
def menu(restaurant_id):
    restaurant = Restaurant.query.get_or_404(restaurant_id)
    menu_items = MenuItem.query.filter_by(restaurant_id=restaurant.id).all()
    return render_template('menu.html', restaurant=restaurant, menu_items=menu_items)

@app.route('/add_favorite/<int:item_id>', methods=['POST'])
def add_favorite(item_id):
    user_id = session.get('user_id')
    if user_id and not Favorite.query.filter_by(user_id=user_id, item_id=item_id).first():
        new_favorite = Favorite(user_id=user_id, item_id=item_id)
        db.session.add(new_favorite)
        db.session.commit()
        flash('Added to favorites!')
    else:
        flash('Already in favorites or not logged in!')

    # Fetch the restaurant ID associated with the item
    item = MenuItem.query.get(item_id)
    if item:
        restaurant_id = item.restaurant_id
        return redirect(url_for('menu', restaurant_id=restaurant_id))
    else:
        flash("Item not found.")
        return redirect(url_for('index'))

@app.route('/remove_favorite/<int:item_id>', methods=['POST'])
def remove_favorite(item_id):
    print(f"Attempting to remove item ID: {item_id}")
    user_id = session.get('user_id')
    if user_id:
        favorite = Favorite.query.filter_by(user_id=user_id, item_id=item_id).first()
        if favorite:
            db.session.delete(favorite)
            db.session.commit()
            print(f"Removed item ID: {item_id}")
            flash('Item removed from favorites!', 'info')
        else:
            print(f"Item ID: {item_id} not found in favorites.")
            flash('Item not found in favorites!', 'warning')
    else:
        flash('You are not logged in!', 'danger')
    
    return redirect(url_for('favorites'))

